import React from "react";

import Skeleton from 'react-loading-skeleton';

const SkeletonBadgeLists = () => {
  return (
    <div className="Badges__container">
        <div className="BadgesList">
          <ul className="list-unstyled">
            {Array(9)
              .fill()
              .map((item, index) => (
                <li key={index}>

                  <div className="card BadgesListItem">
      
                    
                    <Skeleton circle="true" height={80} width={80} />
                   
                     
                    <div className="card-text">
                        <h5 className="card-title">
                          <Skeleton height={20} width={250} count={1} />
                        </h5>
                    </div>
                        
                        
                        <div className="BadgesList__twitter">
                          
                          <div className="BadgeList__twitter-acount">
                            <Skeleton height={20} width={250} /></div>
                          
                        </div>
                        <div><small><Skeleton height={20} width={`80%`} /></small></div>

                        
                     

                    

                  </div>
                </li>
            ))}
          </ul>
              
        </div>
      </div>
            
         
  );

}

export default SkeletonBadgeLists;
